Author.create(name:"J. R. R. Tolkien", dob:'3 January 1892', nationality:'British', awards:'', 	biography:"John Ronald Reuel Tolkien, CBE (/ˈtɒlkiːn/ tol-keen;[a] 3 January 1892 – 2 September 1973) was an English writer, poet, philologist, and university professor, best known as the author of the classic high fantasy works The Hobbit, The Lord of the Rings, and The Silmarillion.
He served as the Rawlinson and Bosworth Professor of Anglo-Saxon and Fellow of Pembroke College, Oxford, from 1925 to 1945 and Merton Professor of English Language and Literature and Fellow of Merton College, Oxford from 1945 to 1959. He was at one time a close friend of C. S. Lewis—they were both members of the informal literary discussion group known as the Inklings. Tolkien was appointed a Commander of the Order of the British Empire by Queen Elizabeth II on 28 March 1972.
After Tolkien's death, his son Christopher published a series of works based on his father's extensive notes and unpublished manuscripts, including The Silmarillion. These, together with The Hobbit and The Lord of the Rings form a connected body of tales, poems, fictional histories, invented languages, and literary essays about a fantasy world called Arda, and Middle-earth[b] within it. Between 1951 and 1955, Tolkien applied the term legendarium to the larger part of these writings. While many other authors had published works of fantasy before Tolkien, the great success of The Hobbit and The Lord of the Rings led directly to a popular resurgence of the genre. This has caused Tolkien to be popularly identified as the 'father' of modern fantasy literature—or, more precisely, of high fantasy.
In 2008, The Times ranked him sixth on a list of 'The 50 greatest British writers since 1945'.[7] Forbes ranked him the 5th top-earning 'dead celebrity' in 2009.
(Source: http://en.wikipedia.org/wiki/J._R._R._Tolkien)", image_url:"http://upload.wikimedia.org/wikipedia/commons/thumb/b/b4/Tolkien_1916.jpg/220px-Tolkien_1916.jpg")
Author.create(name:'Ayn Rand', dob:'February 2 1905', nationality:'Russian Jewish (naturalized American)', awards:'Prometheus Award – Hall of Fame: 1983 Atlas Shrugged, 1987 Anthem', biography:"Ayn Rand (/ˈaɪn ˈrænd/; born Alisa Zinov'yevna Rosenbaum; February 2 [O.S. January 20] 1905 – March 6, 1982) was a Russian-American novelist, philosopher, playwright, and screenwriter. She is known for her two best-selling novels, The Fountainhead and Atlas Shrugged, and for developing a philosophical system she called Objectivism. Born and educated in Russia, Rand moved to the United States in 1926. She had a play produced on Broadway in 1935–1936. After two early novels that were initially unsuccessful in America, she achieved fame with her 1943 novel, The Fountainhead.
In 1957, she published her best-known work, the novel Atlas Shrugged. Afterward, she turned to non-fiction to promote her philosophy, publishing her own magazines and releasing several collections of essays until her death in 1982. Rand advocated reason as the only means of acquiring knowledge and rejected faith and religion. She supported rational and ethical egoism, and rejected altruism. In politics, she condemned the initiation of force as immoral and opposed collectivism and statism as well as anarchism, instead supporting laissez-faire capitalism, which she defined as the system based on recognizing individual rights. In art, Rand promoted romantic realism. She was sharply critical of most philosophers and philosophical traditions known to her, except for some Aristotelians and classical liberals.
Literary critics received Rand's fiction with mixed reviews, and academia generally ignored or rejected her philosophy, though academic interest has increased in recent decades. The Objectivist movement attempts to spread her ideas, both to the public and in academic settings. She has been a significant influence among libertarians and American conservatives.
(Source: http://en.wikipedia.org/wiki/Ayn_Rand)", image_url:'http://upload.wikimedia.org/wikipedia/en/thumb/3/32/Ayn_Rand1.jpg/220px-Ayn_Rand1.jpg')
Author.create(name:'Orson Scott Card', dob:'August 24 1951', nationality:'American', awards:"Hugo Award (Ender's Game, 1986, Speaker for the Dead, 1987, How to Write Science Fiction and Fantasy, 1991)", biography:"Orson Scott Card (born August 24, 1951) is an American novelist, critic, public speaker, essayist and columnist. He writes in several genres but is known best for science fiction. His novel Ender's Game (1985) and its sequel Speaker for the Dead (1986) both won Hugo and Nebula Awards, making Card the only author to win both science fiction's top U.S. prizes in consecutive years. A feature film adaptation of Ender's Game, which Card co-produced, was released in late October 2013 in Europe and on November 1, 2013, in North America.
Card is a professor of English at Southern Virginia University, has written two books on the subject of creative writing, hosts writing bootcamps and workshops, and serves as a judge in the Writers of the Future contest. A great-great-grandson of Brigham Young, Card is a practicing member of The Church of Jesus Christ of Latter-day Saints (LDS Church). In addition to producing a large body of fiction works, he has also offered political, religious, and social commentary in his columns and other writing. 
(Source:http://en.wikipedia.org/wiki/Orson_Scott_Card)", image_url:'http://upload.wikimedia.org/wikipedia/commons/thumb/6/6e/Orson_Scott_Card_at_BYU_Symposium_20080216_closeup.jpg/250px-Orson_Scott_Card_at_BYU_Symposium_20080216_closeup.jpg')
Author.create(name:'William Shakespeare', dob:'26 April 1564', nationality:'English', awards:'', biography:"William Shakespeare (/ˈʃeɪkspɪər/; 26 April 1564 (baptised) – 23 April 1616) was an English poet, playwright and actor, widely regarded as the greatest writer in the English language and the world's pre-eminent dramatist. He is often called England's national poet and the 'Bard of Avon'. His extant works, including some collaborations, consist of about 38 plays, 154 sonnets, two long narrative poems, and a few other verses, the authorship of some of which is uncertain. His plays have been translated into every major living language and are performed more often than those of any other playwright.
Shakespeare was born and brought up in Stratford-upon-Avon. At the age of 18, he married Anne Hathaway, with whom he had three children: Susanna, and twins Hamnet and Judith. Between 1585 and 1592, he began a successful career in London as an actor, writer, and part-owner of a playing company called the Lord Chamberlain's Men, later known as the King's Men. He appears to have retired to Stratford around 1613 at age 49, where he died three years later. Few records of Shakespeare's private life survive, and there has been considerable speculation about such matters as his physical appearance, sexuality, religious beliefs, and whether the works attributed to him were written by others.
Shakespeare produced most of his known work between 1589 and 1613. His early plays were mainly comedies and histories and these works remain regarded as some the best work produced in these genres even today. He then wrote mainly tragedies until about 1608, including Hamlet, King Lear, Othello, and Macbeth, considered some of the finest works in the English language. In his last phase, he wrote tragicomedies, also known as romances, and collaborated with other playwrights.
Many of his plays were published in editions of varying quality and accuracy during his lifetime. In 1623, John Heminges and Henry Condell, two friends and fellow actors of Shakespeare, published the First Folio, a collected edition of his dramatic works that included all but two of the plays now recognised as Shakespeare's. It was prefaced with a poem by Ben Jonson, in which Shakespeare is hailed, presciently, as 'not of an age, but for all time'. In the 20th and 21st century, his work has been repeatedly adopted and rediscovered by new movements in scholarship and performance. His plays remain highly popular today and are constantly studied, performed, and reinterpreted in diverse cultural and political contexts throughout the world. (Source:http://en.wikipedia.org/wiki/William_Shakespeare)", image_url:'http://upload.wikimedia.org/wikipedia/commons/thumb/a/a2/Shakespeare.jpg/250px-Shakespeare.jpg')
