2012: Freedom of the City of London", biography:"Joanne 'Jo' Rowling, OBE FRSL (/ˈroʊlɪŋ/; born 31 July 1965), pen names J. K. Rowling and Robert Galbraith, is a British novelist best known as the author of the Harry Potter fantasy series. The books have gained worldwide attention, won multiple awards, and sold more than 400 million copies. They have become the best-selling book series in history[4] and been the basis for a series of films which became the highest-grossing film series in history. Rowling had overall approval on the scripts and maintained creative control by serving as a producer on the final instalment.
Born in Yate, Gloucestershire, Rowling was working as a researcher and bilingual secretary for Amnesty International when she conceived the idea for the Harry Potter series on a delayed train from Manchester to London in 1990. The seven-year period that followed saw the death of her mother, divorce from her first husband and relative poverty until Rowling finished the first novel in the series, Harry Potter and the Philosopher's Stone in 1997. There were six sequels, the last, Harry Potter and the Deathly Hallows in 2007. Since then, Rowling has written three books for adult readers, The Casual Vacancy (2012) and—under the pseudonym Robert Galbraith—the crime fiction novels The Cuckoo's Calling (2013) and The Silkworm (2014).
Rowling has led a 'rags to riche' life story, in which she progressed from living on state benefits to multi-millionaire status within five years. She is the United Kingdom's best-selling living author, with sales in excess of £238m.[10] The 2008 Sunday Times Rich List estimated Rowling's fortune at £560 million, ranking her as the twelfth richest woman in the United Kingdom. Forbes ranked Rowling as the forty-eighth most powerful celebrity of 2007, and Time magazine named her as a runner-up for its 2007 Person of the Year, noting the social, moral, and political inspiration she has given her fans. In October 2010, Rowling was named the 'Most Influential Woman in Britain' by leading magazine editors. She has supported charities including Comic Relief, One Parent Families, Multiple Sclerosis Society of Great Britain and Lumos (formerly the Children's High Level Group), and in politics supports the Labour Party and Better Together.", image_url:'http://upload.wikimedia.org/wikipedia/commons/thumb/5/5d/J._K._Rowling_2010.jpg/220px-J._K._Rowling_2010.jpg')


